    return '$googleApiAgreement\n\nDatos de ubicación.\nPara comprender el comportamiento del usuario y para funciones futuras, la aplicación transmite datos de uso anónimos.\nLos datos no se comparten con terceros.\nSe puede recopilar información sobre el origen (país y ciudad), idioma, sistema operativo, tipo de dispositivo, resolución, comportamiento de clic y duración del uso.\n\nDatos del dispositivo.\nRecopilamos datos sobre la cantidad y el tipo de dispositivos que utiliza para conectarse al servicio, así como información sobre el sistema operativo de esos dispositivos (por ejemplo, Android, iOS, Windows o macOS).\n\nAl utilizar la aplicación, usted acepta la recopilación de datos anónimos como se describe anteriormente.';
