  @override
  String get privacyBlock6 =>
      'En el marco de la toma de contacto con nosotros (p. ej., mediante formulario de contacto o correo electrónico) se recogen datos personales. Qué datos se recogen en el caso de un formulario de contacto se desprende del propio formulario. Estos datos se almacenan y utilizan exclusivamente con el fin de responder a tu solicitud o para el contacto y la administración técnica asociada. La base jurídica para el tratamiento de los datos es nuestro interés legítimo en responder a tu solicitud de acuerdo con el art. 6, apdo. 1, letra f del RGPD. Si tu contacto tiene como objetivo la celebración de un contrato, la base jurídica adicional para el tratamiento es el art. 6, apdo. 1, letra b del RGPD. Tus datos se eliminarán una vez que hayamos terminado de tramitar tu solicitud, cuando de las circunstancias se pueda deducir que el asunto en cuestión está aclarado y siempre que no existan obligaciones legales de conservación.';

