  @override
  String get privacyBlock7 =>
      'La normativa de protección de datos aplicable te concede frente al responsable amplios derechos del interesado en relación con el tratamiento de tus datos personales (derechos de información e intervención), sobre los que te informamos a continuación:\n\n- Derecho de acceso según el art. 15 RGPD: tienes especialmente derecho a obtener información sobre tus datos personales tratados por nosotros, los fines del tratamiento, las categorías de datos personales tratados, los destinatarios o categorías de destinatarios a los que se han comunicado o se comunicarán tus datos, el periodo de conservación previsto o los criterios utilizados para determinar dicho periodo, la existencia de un derecho de rectificación, supresión, limitación del tratamiento, oposición al tratamiento, reclamación ante una autoridad de control, el origen de tus datos si no los hemos obtenido de ti, la existencia de decisiones automatizadas incluida la elaboración de perfiles y, en su caso, información significativa sobre la lógica implicada y las consecuencias previstas de dicho tratamiento, así como tu derecho a ser informado de las garantías existentes conforme al art. 46 RGPD en caso de transferencia de tus datos a terceros países;\n\n- Derecho de rectificación según el art. 16 RGPD: tienes derecho a la rectificación inmediata de los datos inexactos que te conciernan y/o a completar los datos incompletos que almacenamos;\n\n- Derecho de supresión según el art. 17 RGPD: tienes derecho a solicitar la supresión de tus datos personales cuando se den las condiciones del art. 17, apdo. 1 RGPD. Este derecho no existe, en particular, cuando el tratamiento es necesario para ejercer la libertad de expresión e información, para cumplir una obligación legal, por razones de interés público o para la formulación, el ejercicio o la defensa de reclamaciones;\n\n- Derecho a la limitación del tratamiento según el art. 18 RGPD: tienes derecho a solicitar la limitación del tratamiento de tus datos personales mientras verificamos la exactitud de los datos que impugnas, si rechazas la supresión de tus datos por tratamiento ilícito y solicitas en su lugar la limitación, si necesitamos los datos para la formulación, el ejercicio o la defensa de reclamaciones después de que ya no sean necesarios para la finalidad, o si has presentado oposición por motivos de tu situación particular mientras no se haya verificado si prevalecen nuestros motivos legítimos;\n\n- Derecho de información según el art. 19 RGPD: si has hecho valer frente al responsable el derecho de rectificación, supresión o limitación del tratamiento, este está obligado a comunicar dicha rectificación o supresión de datos o limitación del tratamiento a todos los destinatarios a los que se hayan revelado los datos personales que te conciernen, salvo que resulte imposible o suponga un esfuerzo desproporcionado. Tienes derecho a ser informado sobre dichos destinatarios.\n\n- Derecho a la portabilidad de los datos según el art. 20 RGPD: tienes derecho a recibir los datos personales que nos hayas facilitado en un formato estructurado, de uso común y lectura mecánica, o a solicitar su transmisión a otro responsable, cuando sea técnicamente posible;\n\n- Derecho a revocar consentimientos otorgados según el art. 7, apdo. 3 RGPD: tienes derecho a revocar en cualquier momento con efecto futuro un consentimiento otorgado para el tratamiento de datos. En caso de revocación, eliminaremos inmediatamente los datos afectados si no existe una base legal para un tratamiento posterior sin consentimiento. La revocación no afecta a la licitud del tratamiento realizado hasta la revocación;\n\n- Derecho a presentar una reclamación según el art. 77 RGPD: si consideras que el tratamiento de tus datos personales infringe el RGPD, tienes derecho, sin perjuicio de otros recursos administrativos o judiciales, a presentar una reclamación ante una autoridad de control, en particular en el Estado miembro de tu residencia habitual, tu lugar de trabajo o el lugar de la presunta infracción.';

